Размещаю мопед от хорошего знакомого:

Привет! Мы работаем на рынке кредитования и взыскания долгов 12 лет. В прошлом году мы запустили MoneyRock (<http://money-rock.com>) и выдаём онлайн-займы жителям нищих стран Латинской Америки и Африки под высокие проценты. Мы выбрали страны, в которых живёт много людей, где есть высокое проникновение интернета и где мало конкурентов и мы можем уверенно их бить. Мы ищем риск-аналитика, который выстроит для нас систему управления рисками. 

Что мы даём: 
-доступ к данным из 20+ стран мира; 
-борьбу за конверсии и работу очень на стыке с маркетингом;
-мы готовы давать не только деньги, но и участие в уставном капитале компании. Участие нормальное, а не “вот вырастем - поделимся, может быть“;
-мы умеем и любим в “удалёнку“;
-мы готовы обсуждать релокацию в развитую страну с тёплым климатом, морем и продуктами питания, которые пригоды для употрбления в пищу;
-быстрые принятия решений в коллективе, никакой тягомотины и муторных согласований.

Кто нам нужен: человек с яйцами и инициативой, а не луноход работающий чётко по ТЗ. Человек, который хочет придумывать и тестировать гипотезы, проводить эксперименты, а не предлагает сделанную 100 лет назад для бывшего работодателя скоринговую модель. Ну и человек, который в дальнейшем будет управлять локальными аналитиками на местах.

